import axios from 'axios'



const shopDetail = async (url, setFunc) => {
    const res = await axios({
        method: 'get',
        url,
        headers: {
            'Content-Type': 'application/json;charset=UTF-8',
            'Access-Control-Allow-Origin': '*',
          },
    })
    setFunc(res)
}

export {shopDetail}
